import React from "react";
import PageScroll from "react-page-scroll";

function portfolio() {
  return (
    <PageScroll width="100vw" height="100vh">
      <div id="page1" className="page"></div>
      <div id="page2" className="page"></div>
    </PageScroll>
  );
}

export default portfolio;
